// Create JSON object 

function createJSON() {
    jsonObj = [];

    var subdivision = $("#subdivion").val();
    var streetName = $("#streetName").val();
    var permitNumber = $("#permitNumber").val();
    var computedBy = $("#computedBy").val();
    var bondDate = $("#date").val();

    BondHeader = {}
    BondHeader["subdivision"] = subdivision;
    BondHeader["streetName"] = streetName;
    BondHeader["permitNumber"] = permitNumber;
    BondHeader["computedBy"] = computedBy;
    BondHeader["bondDate"] = bondDate;

    jsonObj.push(BondHeader);

    $('.qty').each(function (i) {

        Qty = $(this).val();
        var row = $(this).parents('.item-row');
       
        var unit = row.find('.unit').val();
        var desc = row.find('.desc').val();
        var cost = row.find('.cost').val();
        var price = row.find('.price').text();
        if (Qty != '' && cost != '₹0.00') {
            item = {}
            item["Qty"] = Qty;
            item["unit"] = unit;
            item["description"] = desc;
            item["cost"] = cost;
            item["price"] = price;
            jsonObj.push(item);
        }
    });


    var cac = $("#subtotal").text();
    cacTotal = {}
    cacTotal["cac"] = cac;
    jsonObj.push(cacTotal);

    // Bond Values 

    var Contigency5 = $("#TaxAmount").text();
    var cacPlusContigency5 = $("#total").text();
    var TotalBond = $("#bond").text();
    
    Bond = {}
    Bond["Contigency5"] = Contigency5;
    Bond["cacPlusContigency5"] = cacPlusContigency5;
    Bond["TotalBond"] = TotalBond;

    jsonObj.push(Bond);

    // permit fee

    var PermitFee = $("#fee").text();
    var efsf = $("#efsf").text();
    var Totalfee = $("#feeTotal").text();

    Permit = {}
    Permit["PermitFee"] = PermitFee;
    Permit["efsf"] = efsf;
    Permit["Totalfee"] = Totalfee;

    jsonObj.push(Permit);

    // saving object 
    localStorage.setItem('BondObject', JSON.stringify(jsonObj));
   
}

function GetTodayDate() {
    var tdate = new Date();
    var dd = tdate.getDate(); //yields day
    var MM = tdate.getMonth(); //yields month
    var yyyy = tdate.getFullYear(); //yields year
    var currentDate = (MM + 1) + "/" + dd + "/" + yyyy;

    return currentDate;
}

