function update_price() {
   
    var price = 0;
    var row = $(this).parents('.item-row');
    console.log(row);
    // Remove leading Zero
    var Qty = row.find('.qty').val();
    isNormalInteger(Qty) ? row.find('.qty').val(Qty) : row.find('.qty').val("0");
    row.find('.qty').val(((row.find('.qty').val().replace("₹", "")).replace(",", "")).replace(/^0+/, ''));

    // Validate Cost value 

    var Cost = row.find('.cost').val();
    var currowcol = row.find('.cost');
   
    //isPositiveNumber(Cost) ? row.find('.cost').val(Cost) : row.find('.cost').val("0");

    currowcol.val(roundNumber(returnPositiveNumber(Cost),2));
    

    // calculate price 
    price = (row.find('.cost').val().replace("₹", "")).replace(",", "") * row.find('.qty').val();

    var tmpcost = row.find('.cost').val().replace("₹", "")
    if (tmpcost != '')
        row.find('.cost').val("₹" + tmpcost);
    price = roundNumber(price, 2);
    isNaN(price) ? row.find('.price').html("N/A") : row.find('.price').html("₹" + price);

   
    selectedRowount = 0;
    // highlight row if qty changed 
    if (row.find('.qty').val() == '' )  {
        DisplayCount();
        row.css("background", "");
        row.find("td input").each(function () {
            $(this).css('background', '');
        });
    }
    else {
        selectedRowount = selectedRowount + 1;
        DisplayCount();
        row.css("background", rowActiveColorCode);
        row.find("td input").each(function () {
            
            $(this).css('background', rowActiveColorCode);
        });
    }

    update_total();
}


